import React from 'react';

const groups = [
    {id:1,name:"test",category:"test",active:true},
    {id:2,name:"test",category:"test",active:true},
    {id:3,name:"test",category:"test",active:true}
  ]
  
const GroupItem = props => {
    return(
        <div>
            <h1>I AM A GROUP</h1>
            {groups.map(group =>(
                <li>
                    name:{group.name}

                </li>
            ))}
        </div>
    )

}


export default GroupItem;
